import React, { Component } from 'react'
import Container from 'react-bootstrap/Container';
import Navbar from 'react-bootstrap/Navbar';


let arr=["Delhi","Mumbai","Bangalore","Chennai"]

export default class NavigationBar extends Component {
  render() {
    return <div>
      <Navbar className="bg-white border bg-primary" >
        <Container className='bg-dark'  style={{width:"30%"}} >
          <Navbar.Brand href="#home" >
            <img
              alt="logo"
              src="https://drive.google.com/thumbnail?id=1poFTLph9EAz5v-J8wPB-PzuKa30-F0mb&sz=w1000"
              width="35"
              height="35"
              className="d-inline-block align-top rounded-circle"
            />{' '}
            BookMyClean
          </Navbar.Brand>
          <div>
            <select className="form-control"  onChange={this.handleChange}>
              {
                  arr.map((a)=><option>{a}</option>)
              }
            </select>
          </div>
        </Container>
        
        
      </Navbar></div>
    
  }
}
